    description: The FoodOn "food product" class is provided as a branch under which
      new food product categories and food products themselves can be placed. Here
      classes are provided to differentiate a food product by its food composition,
      processing and/or consumption characteristics. This avoids brand name products
      but it may include generic food dish categories. It has a much greater depth
      and polyhierarchy than other agency product type schemes have in an effort to
      group related products together.  The upper level basis of this tree originated
      in the environment ontology (ENVO) and from the US Code of Federal Regulations.
